import React from "react";
import { Link } from "react-router-dom";

const success = data => {
  const id = data.id;
  const receipt_url = data.receipt_url;
  return (
    <div>
      {id}
      <Link to={{ receipt_url }}>{receipt_url}</Link>
      success
    </div>
  );
};

export default success;
